import React, { useState } from 'react';
import {
  Box,
  Grid,
  Paper,
  Typography,
  LinearProgress,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
} from '@mui/material';
import { Add as AddIcon } from '@mui/icons-material';

const categories = [
  'Groceries',
  'Transportation',
  'Entertainment',
  'Bills',
  'Shopping',
  'Healthcare',
  'Other',
];

function Budget() {
  const [open, setOpen] = useState(false);
  const [budgets, setBudgets] = useState([
    {
      id: 1,
      category: 'Groceries',
      amount: 500,
      spent: 350,
      period: 'monthly',
    },
    {
      id: 2,
      category: 'Entertainment',
      amount: 200,
      spent: 150,
      period: 'monthly',
    },
  ]);

  const [newBudget, setNewBudget] = useState({
    category: '',
    amount: '',
    period: 'monthly',
  });

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
    setNewBudget({
      category: '',
      amount: '',
      period: 'monthly',
    });
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewBudget({
      ...newBudget,
      [name]: value,
    });
  };

  const handleSubmit = () => {
    const budget = {
      id: budgets.length + 1,
      ...newBudget,
      amount: parseFloat(newBudget.amount),
      spent: 0,
    };
    setBudgets([...budgets, budget]);
    handleClose();
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 3 }}>
        <Typography variant="h4">Budget</Typography>
        <Button
          variant="contained"
          startIcon={<AddIcon />}
          onClick={handleClickOpen}
        >
          Add Budget
        </Button>
      </Box>

      <Grid container spacing={3}>
        {budgets.map((budget) => (
          <Grid item xs={12} md={6} key={budget.id}>
            <Paper sx={{ p: 2 }}>
              <Box sx={{ mb: 2 }}>
                <Typography variant="h6">{budget.category}</Typography>
                <Typography color="textSecondary">
                  ${budget.spent} of ${budget.amount} spent
                </Typography>
              </Box>
              <LinearProgress
                variant="determinate"
                value={(budget.spent / budget.amount) * 100}
                sx={{ height: 10, borderRadius: 5 }}
              />
              <Box sx={{ display: 'flex', justifyContent: 'space-between', mt: 1 }}>
                <Typography variant="body2" color="textSecondary">
                  {((budget.spent / budget.amount) * 100).toFixed(1)}% used
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  ${(budget.amount - budget.spent).toFixed(2)} remaining
                </Typography>
              </Box>
            </Paper>
          </Grid>
        ))}
      </Grid>

      {/* Add Budget Dialog */}
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Add New Budget</DialogTitle>
        <DialogContent>
          <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, pt: 2 }}>
            <FormControl fullWidth>
              <InputLabel>Category</InputLabel>
              <Select
                name="category"
                value={newBudget.category}
                onChange={handleInputChange}
                label="Category"
              >
                {categories.map((category) => (
                  <MenuItem key={category} value={category}>
                    {category}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>

            <TextField
              name="amount"
              label="Amount"
              type="number"
              value={newBudget.amount}
              onChange={handleInputChange}
              fullWidth
            />

            <FormControl fullWidth>
              <InputLabel>Period</InputLabel>
              <Select
                name="period"
                value={newBudget.period}
                onChange={handleInputChange}
                label="Period"
              >
                <MenuItem value="weekly">Weekly</MenuItem>
                <MenuItem value="monthly">Monthly</MenuItem>
                <MenuItem value="yearly">Yearly</MenuItem>
              </Select>
            </FormControl>
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSubmit} variant="contained">
            Add
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default Budget;
